jQuery(document).ready(function($){"use strict";$(document).on("cmplzCookieWarningLoaded",cmplz_autocheck_delayed);function cmplz_autocheck_delayed(){setTimeout(cmplz_autocheck,1e3)}function cmplz_autocheck(){if(complianz.tm_categories){for(var i=0;i<complianz.cat_num;i++){if(cmplzGetCookie("cmplz_event_"+i)!==false)$(".cmplz_"+i).prop("checked",true)}}if(cmplzGetCookie("cmplz_marketing")===""){$(".cmplz_marketing").prop("checked",true)}if(cmplzGetCookie("cmplz_stats")===""){$(".cmplz_stats").prop("checked",true)}if(cmplzGetCookie("cmplz_prefs")===""){$(".cmplz_prefs").prop("checked",true)}}function cmplzGetCookie(cname){var name=cname+"=";var cArr=window.document.cookie.split(";");for(var i=0;i<cArr.length;i++){var c=cArr[i].trim();if(c.indexOf(name)==0)return c.substring(name.length,c.length)}return""}});